libs.content:
find_library(sdl2_library_temp
	names sdl2
	hints
	$env{sdl2dir}
	path_suffixes lib64 lib
	paths ${sdl2_search_paths}
)

find_library(sdl2main_library
			names sdl2main
			hints
			$env{sdl2dir}
			path_suffixes lib64 lib
			paths ${sdl2_search_paths}
		)

find_library(${_var}
    names ${_names}
    paths ${_cuda_64bit_lib_dir}
          "${cuda_toolkit_root_dir}/lib"
    env cuda_lib_path
    doc ${_doc}
    no_default_path
    )
